INSERT INTO `ji_block` VALUES('12','1','首页公司简介','index_about_content','1','吉平化工主要生产经营的产品有：环保清洗材料、漂洗原料、电镀原料、环保水处理原料、日化原料、化学试剂及稀有化工原料等。同时经营多家著名化 工公司的二十多种产品，是吉化在的华南地区的主要代理商;也是墨西哥喜赫石油公司FMEE及FMES华南区的代理商;吉平化工还现货供应美国陶氏化学，巴 斯夫公司等多种品牌的多种产品。','');
