INSERT INTO `ji_block_history` VALUES('85','12','array (\n  \'id\' => \'12\',\n  \'siteid\' => \'1\',\n  \'name\' => \'首页公司简介\',\n  \'pos\' => \'index_about_content\',\n  \'type\' => \'1\',\n  \'data\' => \'GOODGOODGOODGOODGOODGOODGOODGOODG<br />\r\nOODGOODGOODGOODGOODGOODGOODGOODGO<br />\r\nODGOODGOODGOODGOODGOODGOODGOODGOO<br />\r\nDGOODGOODGOODGOODGOODGOODGOODGOOD<br />\r\nGOODGOODGOODGOODGOOD\',\n  \'template\' => \'\',\n)','1368759999','2','zeeeda');
INSERT INTO `ji_block_history` VALUES('86','12','array (\n  \'id\' => \'12\',\n  \'siteid\' => \'1\',\n  \'name\' => \'首页公司简介\',\n  \'pos\' => \'index_about_content\',\n  \'type\' => \'1\',\n  \'data\' => \'<p>深圳市吉平化工有限公司是一间专业从事化工原料销售的公司，吉平化工位于广东省深圳市平湖街道华南城M13栋 127号。吉平化工主要生产经营的产品有：环保清洗材料、漂洗原料、电镀原料、环保水处理原料、日化原料、化学试剂及稀有化工原料等。同时经营多家著名化 工公司的二十多种产品，是吉化在的华南地区的主要代理商;也是墨西哥喜赫石油公司FMEE及FMES华南区的代理商;吉平化工还现货供应美国陶氏化学，巴 斯夫公司等多种品牌的多种产品。吉平化工主要负责人从事化工行业十余年，有丰富的理论知识与实践经验。吉平化工拥有一批高质素的专业销售人员，不仅能为广 大的客户提供品质优良，价格合理的化工原料，还能为广大的客户提供一定的技术支持。吉平化工本着&quot;诚信，务实，发展&quot;的原则，更好地服务广大客户，致力为 广大客户提供更方便、快捷、周到的服务。吉平化工全体人员真诚期待与广大客户建立良好的合作关系，共创美好明天。</p>\r\n<p>现货有美国陶氏 化学原装的NP-10、NP-9、NP-8、NP-7、NP-6、NP-4、PEG- 200、PEG-400、PEG-600、AE0-3、AEO-7、AEO-9、EH-9、EH-7、一乙醇胺、二乙醇胺、三乙醇胺、PM、DPM、 BCS、BDG;墨西哥喜赫石油公司出品的FMEE及FMES;南京磺酸;西普油酸;马来甘油;台湾三氯化铁及山东青岛无水三氯化铁;工业盐及无磷无铬环 保型皮膜剂等优惠销售!</p>\',\n  \'template\' => \'\',\n)','1368760032','2','zeeeda');
